import Header from "./MyComponents/Header";
import {Todos} from "./MyComponents/Todos";
import {Footer}from "./MyComponents/Footer";
import React, { useState } from 'react';


function App() {
  const onDelete = (todo)=>{
    console.log("Delete",todo);
  }

  let todos = [
    {
      sno: 1,
      title: "Do task1",
      desc: "Complete your task1"
    },
    {
      sno: 2,
      title: "Do task2",
      desc: "Complete your task2"
    },
    {
      sno: 3,
      title: "Do task3",
      desc: "Complete your task3"
    }
  ]
  return (
    <>
      <Header/> 
      <Todos todos={todos} onDelete={onDelete}/>
      <Footer/>
    </>
  );
}

export default App;
